import React from "react";
import { Redirect } from "react-router-dom";

// Layout Types
import { DefaultLayout } from "./layouts";

// Route Views
import BlogOverviewdathuc from "./views/BlogOverviewdathuc";
import AddNewPosttichphan from "./views/AddNewPosttichphan";
import ComponentsOverviewdothi from "./views/ComponentsOverviewdothi";
import Tablestonghop from "./views/Tablestonghop";
import BlogPostsdaoham from "./views/BlogPostsdaoham";

export default [
  {
    path: "/",
    exact: true,
    layout: DefaultLayout,
    component: () => <Redirect to="/blog-overviewdathuc" />
  },
  {
    path: "/blog-overviewdathuc",
    layout: DefaultLayout,
    component: BlogOverviewdathuc
  },
  {
    path: "/add-new-posttichphan",
    layout: DefaultLayout,
    component: AddNewPosttichphan
  },
  {
    path: "/components-overviewdothi",
    layout: DefaultLayout,
    component: ComponentsOverviewdothi
  },
  {
    path: "/tablestonghop",
    layout: DefaultLayout,
    component: Tablestonghop
  },
  {
    path: "/blog-postsdaoham",
    layout: DefaultLayout,
    component: BlogPostsdaoham
  }
];
